#include <iostream>
#include <cmath>
#include <cstdlib>
using namespace std;
void create (double Array[], int array_size);
void display_all (double Array[], int array_size);
void calculate (double Array[], int array_size);
int main()
{
    double x;
    cout <<"Input X: ";
    cin >>x;
    const int SIZE=x+120;
    double Array[SIZE];
    create (Array, SIZE);
    display_all (Array, SIZE);
    calculate (Array, SIZE);
    return 0;
}
void create (double Array[], int array_size)
{
    for (int i=0; i<array_size; i++)
    {
        Array[i]=(4+Array[i-1])/(i+1);
    }
}
void display_all (double Array[], int array_size)
{
    for (int i=0; i<array_size; i++)
    {
        cout << "Array["<<i<<"] "<<Array[i]<<endl;
    }
}
void calculate (double Array[], int array_size)
{
    double k;
    double srednia;
    for (int i=0; i<array_size; i++)
        if ((i)%2!=0)
    {
        k=k+Array[i];
    }
    srednia=k/120;
    cout << "Average value = "<<srednia<<endl;
}

